def productExceptSelf_Final(nums):
    prodarray = []
    backprod = 1
    frontprod = 1
    for elem in range(len(nums)):
        if elem == 0:
            prodarray.append(backprod)
        else:
            backprod *= nums[elem-1]
            prodarray.append(backprod)
    ind = len(nums)-1
    while ind >= 0:
        if ind == len(nums)-1:
            prodarray[ind] *= frontprod
        else:
            frontprod *= nums[ind+1]
            prodarray[ind] *= frontprod
        ind -= 1
    return prodarray